import React, {useState} from "react";
import {FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import {faPlus} from '@fortawesome/free-solid-svg-icons'


function SearchBar(){
    const [todoText, setTodoText] = useState("");
    function addTodo(e){
        setTodoText(e.target.value);
    }

    return(
        <section id="searchbar">
            <input type="text" className=" rounded-l-lg w-1/4 shadow-md p-4 focus:outline-none "/>
            <button onClick={addTodo} className="rounded-r-lg bg-red-800 p-4 shadow-md"><FontAwesomeIcon icon={faPlus} className="text-white"/></button>


        </section>
)


}



export default SearchBar;
